import React from 'react';

function Task() {
    return (
        <div className="grid grid-cols-1 md:grid-cols-2 justify-center gap-2">

            <TaskCard bgColor="bg-indigo-100" title="Pre-Check" />
            <TaskCard bgColor="bg-indigo-100" title="Deploy-Automation" />

            <TaskDetailCard bgColor="bg-gray-200" />

            <TaskCard bgColor="bg-red-200" title="Pre-Check" />
            <TaskCard bgColor="bg-red-200" title="Deploy-Automation" />

            <TaskDetailCard bgColor="bg-red-200" />

        </div>
    );
}

const TaskCard = ({ bgColor, title }) => (
    <div className={`w-[600px] h-[100px] ${bgColor} rounded-[10px] flex items-start p-4 space-x-4`}>
        <div className="w-[46px] h-[46px] rounded-md border border-black" />
        <div>
            <div className="text-zinc-500 text-xs font-normal tracking-wide">{title}</div>
            <div className="text-black text-[22px] font-normal mb-1">{title}</div>
        </div>
    </div>
);

const TaskDetailCard = ({ bgColor }) => (
    <div className={`w-[600px] h-[370px] ${bgColor} rounded-[10px] flex flex-col p-4 space-y-4`}>
        <DetailHeader />
        <DetailContent />
        <DetailContent />
        <DetailContent />
    </div>
);

const DetailHeader = () => (
    <div className="flex items-start space-x-4">
        <div className="w-[46px] h-[46px] rounded-md border border-black flex flex-col items-center">
            <div className="w-px h-5 bg-neutral-400" />
        </div>
        <div>
            <div className="text-black text-[22px] font-normal mb-1">
                Components are created for common elements.
            </div>
            <div className="text-zinc-500 text-xs font-normal tracking-wide">
                DESIGN
            </div>
        </div>
    </div>
);

const DetailContent = () => (
    <div className="w-[400px] h-20 relative">
        <div className="w-[30px] h-[30px] left-0 top-[25px] absolute">
            <div className="w-[30px] h-[30px] left-0 top-0 absolute rounded-md border border-green-600" />
        </div>
        <div className="w-[346px] h-[30px] left-[54px] top-[25px] absolute text-zinc-600 text-lg font-normal">
            Component content is easily tweaked.
        </div>
        <div className="w-px h-5 left-[15px] top-0 absolute bg-neutral-400" />
        <div className="w-px h-5 left-[15px] top-[60px] absolute bg-neutral-400" />
    </div>
);

export default Task;
